console.log("test");var link=document.querySelector(".link-popup");var popup=document.querySelector(".modal-feedback");var close=document.querySelector(".modal-close");var tab=document.querySelectorAll(".service-item-title");var tabContent=document.querySelectorAll(".service-item-content");var linkmap=document.querySelector(".open-map");var modalmap=document.querySelector(".modal-map");var mapclose=document.querySelector(".modal-close-map");link.addEventListener("click",function(a){a.preventDefault();popup.classList.add("modal-show")});close.addEventListener("click",function(a){a.preventDefault();popup.classList.remove("modal-show")});function hideTabsContent(b){for(var c=b;c<tabContent.length;c++){tabContent[c].classList.add("service-item-content-hide")}}window.onload=function(){hideTabsContent(1)};document.querySelector(".service-wrapper").onclick=function(c){console.log("был клик");var d=c.target;if(d.className=="service-item-title"){for(var b=0;b<tab.length;b++){if(d==tab[b]){for(var a=0;a<tab.length;a++){tab[a].classList.remove("service-item-title-active")}tab[b].classList.add("service-item-title-active");showTabsContent(b);break}}}};function showTabsContent(a){if(tabContent[a].classList.contains("service-item-content-hide")){hideTabsContent(0);tabContent[a].classList.remove("service-item-content-hide")}}linkmap.addEventListener("click",function(a){a.preventDefault();modalmap.classList.add("modal-map-show")});mapclose.addEventListener("click",function(a){a.preventDefault();modalmap.classList.remove("modal-map-show")});
